using System;
using System.IO;

namespace Petscii_Robots_TSX_converter
{
    class Program
    {
        static void Main(string[] args)
        {
            byte userOption;
            string filePath;

            Console.WriteLine("Choose a operation:");
            Console.WriteLine(" 1.TSX to PETROBOTS");
            Console.WriteLine(" 2.PETROBOTS to TSX");

            userOption = Convert.ToByte(Console.ReadLine());

            Console.WriteLine("INSERT FILE PATH:");
            filePath = Console.ReadLine();
            if (userOption == 1)
            {
                if (!filePath.EndsWith(".tmx"))
                {
                    Console.WriteLine("ERROR: Invalid file type!");
                    return;
                }
                ConvertToPET(filePath);
            }
            else
            {
                ConvertToTMX(filePath);
            }

        }

        static void ConvertToPET(string path)
        {
            using (var reader = new StreamReader(path))
            {
                while (!reader.ReadLine().Contains("<data encoding=\"csv\">")) { }
                string fileData = "";
                for (int i = 0; i < 64; i++)
                {
                    fileData += reader.ReadLine();
                }

                int[] mapData = Array.ConvertAll(fileData.Split(","), s => int.Parse(s));

                byte[] fileBin = new byte[8962];

                petBaseFile.CopyTo(fileBin, 0);

                for(int i = 0; i < 128*64; i++)
                {
                    fileBin[i + 0x302] = Convert.ToByte(mapData[i]-1); 
                }

                File.WriteAllBytes("map", fileBin);
                Console.WriteLine("BINARY FILE GENERATED!");

            }
        }

        static void ConvertToTMX(string path)
        {
            byte[] mapData = File.ReadAllBytes(path);

            string fileTMX = "<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n";
            fileTMX += "<map version=\"1.5\" tiledversion=\"1.7.2\" orientation=\"orthogonal\" renderorder=\"right - down\" width=\"128\" height=\"64\" tilewidth=\"24\" tileheight=\"24\" infinite=\"0\" nextlayerid=\"3\" nextobjectid=\"1\">\n";
            fileTMX += "<tileset firstgid=\"1\" source=\"genesistileset.tsx\"/>\n";
            fileTMX += "<layer id=\"1\" name=\"Camada de Tiles 1\" width=\"128\" height=\"64\">\n";
            fileTMX += "  <data encoding=\"csv\">\n";
            for(int i = 0; i < 8192; i++)
            {
                fileTMX += mapData[i + 0x302] + 1;
                if (i < 8191)
                    fileTMX += ",";
            }
            fileTMX += "\n</data>\n</layer>\n</map>\n";

            File.WriteAllText("map.tmx", fileTMX);
            Console.WriteLine("TMX FILE GENERATED!");
        }

